    const [user,setUser] = useState([
        {name:'Igor',age:20,id:1},
        {name:'Nazar',age:30,id:2},
        {name:'Oleksandra',age:40,id:3},

    ])
    return <div >
        {user.map((user)=>{
            return <div>
                <h1>{user.id}</h1>
                <p>{user.name}</p>
                <p>{user.age}</p>
            </div>
        })}
    </div>

}

export default Button;
